           <h3 className="loginLogo">Mishrasocial</h3>
           <span className="loginDesc">
            Connect with friends and the world around you on Mishrasocial.
           </span>
         </div>
         <div className="loginRight">
          <div className="loginBox"></div>
         </div>
 		</div>
 		</div>
 		);
 }

 export default Login;
